import React, { Component } from 'react';
import IndexContainer from './components/IndexContainer.js'
import './App.css'

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <link
              rel="stylesheet"
              href="https://maxcdn.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
              integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T"
              crossOrigin="anonymous"
          />
        </header>
        <body>
          <div className="lip-background cd-fixed-bg">
              <div className="lip-opacity">
                  <div className="lip-container" style={{marginTop: 3.5 + 'em'}}>
                      <img src={require('./title.png')} />
                      <IndexContainer/>
                  </div>
              </div>
              <div className="output-container">
                  <h1>asdfsadf</h1>
              </div>
          </div>

          {/*<div className="cd-fixed-bg cd-fixed-bg--1">*/}
          {/*    <h1>asdfsadf</h1>*/}
          {/*</div>*/}

          {/*<div className="cd-scrolling-bg cd-scrolling-bg--color-2">*/}
          {/*    <div className="cd-scrolling-bg__content">*/}
          {/*        <p>*/}
          {/*            Lorem ipsum dolor sit amet, consectetur adipisicing elit. Dolore incidunt suscipit similique,*/}
          {/*            dolor corrupti cumque qui consectetur autem laborum fuga quas ipsam doloribus sequi...*/}
          {/*        </p>*/}
          {/*    </div>*/}
          {/*</div>*/}
        </body>
      </div>
    );
  }
}

export default App;
